import React from 'react'
import { Row, Col } from 'antd';

import Tshirt from '../components/Tshirt'
import CartPage from './CartPage'

const ProductPage = () => {

    const database = [
        { name : "red tshirt " , price:150 , id : 1},
        { name : "yellow tshirt " , price:180 , id : 2},
        { name : "green tshirt " , price:200 , id : 3}
    ]

    return (
        <div>
            <Row>
            {
                database.map(item =>(
                    <Col span={12}>
                    <Tshirt id={item.id} name={item.name} price={item.price} key={item.id} />
                    </Col>
                ))
            }

            </Row>

        </div>
    )
}

export default ProductPage
